import React from 'react';
import { NavLink } from 'react-router-dom';
import web from "../src/images/hero-img.png";
import Common from './Common';

const About = () => {
    return (
        <>
         <Common 
            name='Welcome To About Page' 
            imgsrc={web} 
            visit="/contact" 
            btname="Contact Now" 
         />
        </>
    )
}
export default About;
